void get_CO2_info(CO2_info *__restrict info) {
  info->molar_mass = wmm;
  info->T_critical = T_crit;
  info->D_critical = D_crit;
  info->P_critical = P_crit;
  info->temp_lower_limit = T_lower_limit;
  info->temp_upper_limit = T_upper_limit;
  info->pres_lower_limit = P_lower_limit;
  info->pres_upper_limit = P_upper_limit;
  info->sat_temp_min = T_sat_min;
  info->sat_pres_min = P_sat_min;
}

const char *CO2_error_message(const int error_code) {
  switch (error_code) {
  case 0:
    return "";
  case 101:
    return "CO2_TD: specified temperature below minimum value of 220 K";
  case 102:
    return "CO2_TD: specified temperature above maximum value of 1,500 K";
  case 103:
    return "CO2_TD: specified inputs result in pressure below minimum value of 1 "
           "kPa";
  case 104:
    return "CO2_TD: specified inputs result in pressure above maximum value of "
           "60,000 kPa";
  case 201:
    return "CO2_TP: specified temperature below minimum value of 220 K";
  case 202:
    return "CO2_TP: specified temperature above maximum value of 1,500 K";
  case 203:
    return "CO2_TP: specified pressure below minimum value of 1 kPa";
  case 204:
    return "CO2_TP: specified pressure above maximum value of 60,000 kPa";
  case 205:
    return "CO2_TP: specified temperature and pressure correspond to saturation "
           "point; state is undefined";
  case 206:
    return "CO2_TP: an error occurred while solving for the density that "
           "corresponds to the specified pressure";
  case 301:
    return "CO2_PH: specified inputs result in temperature below minimum value of "
           "220 K";
  case 302:
    return "CO2_PH: specified inputs result in temperature above maximum value of "
           "1,500 K";
  case 303:
    return "CO2_PH: specified pressure below minimum value of 1 kPa";
  case 304:
    return "CO2_PH: specified pressure above maximum value of 60,000 kPa";
  case 305:
    return "CO2_PH: an error occurred when solving for the T and D that "
           "corresponds to the specified P and H";
  case 401:
    return "CO2_PS: specified inputs result in temperature below minimum value of "
           "220 K";
  case 402:
    return "CO2_PS: specified inputs result in temperature above maximum value of "
           "1,500 K";
  case 403:
    return "CO2_PS: specified pressure below minimum value of 1 kPa";
  case 404:
    return "CO2_PS: specified pressure above maximum value of 60,000 kPa";
  case 405:
    return "CO2_PS: an error occurred when solving for the T and D that "
           "corresponds to the specified P and H";
  case 501:
    return "CO2_HS: specified inputs result in temperature below minimum value of "
           "220 K";
  case 502:
    return "CO2_HS: specified inputs result in temperature above maximum value of "
           "1,500 K";
  case 503:
    return "CO2_HS: specified inputs result in pressure below minimum value of 1 "
           "kPa";
  case 504:
    return "CO2_HS: specified inputs result in pressure above maximum value of "
           "60,000 kPa";
  case 505:
    return "CO2_HS: an error occurred when solving for the T and D that "
           "corresponds to the specified H and S";
  case 601:
    return "CO2_TQ: specified temperature below minimum saturation value of 220 K";
  case 602:
    return "CO2_TQ: specified temperature greater than or equal to critical "
           "temperature of 304.1282 K";
  case 603:
    return "CO2_TQ: specified quality cannot be less than 0.0 or greater than 1.0";
  default:
    return "an unknown error occurred";
  }
}

void N_co2_props::zero_state(CO2_state *__restrict state) {
  state->temp = 0.0;
  state->pres = 0.0;
  state->dens = 0.0;
  state->qual = 0.0;
  state->inte = 0.0;
  state->enth = 0.0;
  state->entr = 0.0;
  state->cv = 0.0;
  state->cp = 0.0;
  state->ssnd = 0.0;
  state->sat_vap_dens = 0.0;
  state->sat_liq_dens = 0.0;
}

void N_co2_props::get_derivatives(const double x, const double y,
                                  const double D, const Element *__restrict e,
                                  double *__restrict f, double *__restrict dfdD,
                                  double *__restrict dfdD2,
                                  double *__restrict dfdT,
                                  double *__restrict dfdDdT,
                                  double *__restrict dfdT2) {
  double cy[6], cy_dT[6], cy_dT2[6];
  for (int i = 0; i < 6; ++i) {
    cy[i] = e->c[0][i] * y + e->c[1][i];
    cy_dT[i] = e->c[0][i] * y + cy[i];
    cy[i] = cy[i] * y + e->c[2][i];
    cy_dT2[i] = e->c[0][i] * y + cy_dT[i];
    cy_dT[i] = cy_dT[i] * y + cy[i];
    cy[i] = cy[i] * y + e->c[3][i];
    cy_dT2[i] = cy_dT2[i] * y + cy_dT[i];
    cy_dT[i] = cy_dT[i] * y + cy[i];
    cy[i] = cy[i] * y + e->c[4][i];
    cy_dT2[i] = 2.0 * (cy_dT2[i] * y + cy_dT[i]);
    cy_dT[i] = cy_dT[i] * y + cy[i];
    cy[i] = cy[i] * y + e->c[5][i];
  }
  if (e->x_low < D_form_switch) {
    const double ln_D = log(D);
    const double inv_D = 1.0 / D;
    *f = cy[0] * x + cy[1];
    *dfdT = cy_dT[0] * x + cy_dT[1];
    *dfdT2 = cy_dT2[0] * x + cy_dT2[1];
    *dfdD = cy[0] * x + *f;
    *dfdDdT = cy_dT[0] * x + *dfdT;
    *f = *f * x + cy[2];
    *dfdT = *dfdT * x + cy_dT[2];
    *dfdT2 = *dfdT2 * x + cy_dT2[2];
    *dfdD2 = cy[0] * x + *dfdD;
    *dfdD = *dfdD * x + *f;
    *dfdDdT = *dfdDdT * x + *dfdT;
    *f = *f * x + cy[3];
    *dfdT = *dfdT * x + cy_dT[3];
    *dfdT2 = *dfdT2 * x + cy_dT2[3];
    *dfdD2 = 2.0 * (*dfdD2 * x + *dfdD);
    *dfdD = *dfdD * x + *f;
    *f = *f * x + cy[4] + cy[5] * ln_D;
    *dfdDdT = *dfdDdT * x + *dfdT;
    *dfdD = *dfdD * e->inv_dx + cy[5] * inv_D;
    *dfdT = (*dfdT * x + cy_dT[4] + cy_dT[5] * ln_D) * e->inv_dy;
    *dfdD2 = *dfdD2 * e->inv_dx * e->inv_dx - cy[5] * inv_D * inv_D;
    *dfdDdT = *dfdDdT * e->inv_dx + cy_dT[5] * inv_D;
    *dfdT2 = *dfdT2 * x + cy_dT2[4] + cy_dT2[5] * ln_D;
    *dfdDdT = *dfdDdT * e->inv_dy;
    *dfdT2 = *dfdT2 * e->inv_dy * e->inv_dy;
  } else {
    *f = cy[0] * x + cy[1];
    *dfdT = cy_dT[0] * x + cy_dT[1];
    *dfdT2 = cy_dT2[0] * x + cy_dT2[1];
    *dfdD = cy[0] * x + *f;
    *dfdDdT = cy_dT[0] * x + *dfdT;
    *f = *f * x + cy[2];
    *dfdT = *dfdT * x + cy_dT[2];
    *dfdT2 = *dfdT2 * x + cy_dT2[2];
    *dfdD2 = cy[0] * x + *dfdD;
    *dfdD = *dfdD * x + *f;
    *dfdDdT = *dfdDdT * x + *dfdT;
    *f = *f * x + cy[3];
    *dfdT = *dfdT * x + cy_dT[3];
    *dfdT2 = *dfdT2 * x + cy_dT2[3];
    *dfdD2 = *dfdD2 * x + *dfdD;
    *dfdD = *dfdD * x + *f;
    *dfdDdT = *dfdDdT * x + *dfdT;
    *f = *f * x + cy[4];
    *dfdT = *dfdT * x + cy_dT[4];
    *dfdT2 = *dfdT2 * x + cy_dT2[4];
    *dfdD2 = 2.0 * (*dfdD2 * x + *dfdD);
    *dfdD = *dfdD * x + *f;
    *dfdDdT = *dfdDdT * x + *dfdT;
    *f = *f * x + cy[5];
    *dfdT = *dfdT * x + cy_dT[5];
    *dfdT2 = *dfdT2 * x + cy_dT2[5];
    *dfdD = *dfdD * e->inv_dx;
    *dfdT = *dfdT * e->inv_dy;
    *dfdD2 = *dfdD2 * e->inv_dx * e->inv_dx;
    *dfdT2 = *dfdT2 * e->inv_dy * e->inv_dy;
    *dfdDdT = *dfdDdT * e->inv_dx * e->inv_dy;
  }
}

void N_co2_props::get_two_phase_derivatives(
    const double x, const double y, const double D, const Element *__restrict e,
    double *__restrict f, double *__restrict dfdD, double *__restrict dfdT) {
  double cy[6], cy_dT[6];
  for (int i = 0; i < 6; ++i) {
    cy[i] = e->c[0][i] * y + e->c[1][i];
    cy_dT[i] = e->c[0][i] * y + cy[i];
    cy[i] = cy[i] * y + e->c[2][i];
    cy_dT[i] = cy_dT[i] * y + cy[i];
    cy[i] = cy[i] * y + e->c[3][i];
    cy_dT[i] = cy_dT[i] * y + cy[i];
    cy[i] = cy[i] * y + e->c[4][i];
    cy_dT[i] = cy_dT[i] * y + cy[i];
    cy[i] = cy[i] * y + e->c[5][i];
  }
  if (e->x_low < D_form_switch) {
    const double ln_D = log(D);
    *f = cy[0] * x + cy[1];
    *dfdT = cy_dT[0] * x + cy_dT[1];
    *dfdD = cy[0] * x + *f;
    *f = *f * x + cy[2];
    *dfdT = *dfdT * x + cy_dT[2];
    *dfdD = *dfdD * x + *f;
    *f = *f * x + cy[3];
    *dfdT = *dfdT * x + cy_dT[3];
    *dfdD = *dfdD * x + *f;
    *f = *f * x + cy[4] + cy[5] * ln_D;
    *dfdT = *dfdT * x + cy_dT[4] + cy_dT[5] * ln_D;
    *dfdD = *dfdD * e->inv_dx + cy[5] / D;
    *dfdT = *dfdT * e->inv_dy;
  } else {
    *f = cy[0] * x + cy[1];
    *dfdT = cy_dT[0] * x + cy_dT[1];
    *dfdD = cy[0] * x + *f;
    *f = *f * x + cy[2];
    *dfdT = *dfdT * x + cy_dT[2];
    *dfdD = *dfdD * x + *f;
    *f = *f * x + cy[3];
    *dfdT = *dfdT * x + cy_dT[3];
    *dfdD = *dfdD * x + *f;
    *f = *f * x + cy[4];
    *dfdT = *dfdT * x + cy_dT[4];
    *dfdD = *dfdD * x + *f;
    *f = *f * x + cy[5];
    *dfdT = *dfdT * x + cy_dT[5];
    *dfdD = *dfdD * e->inv_dx;
    *dfdT = *dfdT * e->inv_dy;
  }
}

