int CO2_TD(const double T, const double D, CO2_state *__restrict state) {
  double dens_vap = 0.0;
  double dens_liq = 0.0;
  double Q = 999.0;
  if (T < T_crit) {
    if (T < T_lower_limit) {
      zero_state(state);
      return 101;
    }
    dens_vap = CO2_sat_vap_dens(T);
    dens_liq = CO2_sat_liq_dens(T);
    if (D < dens_liq && D > dens_vap) {
      Element e;
      find_element(T, dens_liq, &e);
      const double x_liq = (dens_liq - e.x_low) * e.inv_dx;
      const double y_liq = (T - e.y_low) * e.inv_dy;
      double f_liq, dfdD_liq, dfdT_liq;
      get_two_phase_derivatives(x_liq, y_liq, dens_liq, &e, &f_liq, &dfdD_liq,
                                &dfdT_liq);
      find_element(T, dens_vap, &e);
      const double x_vap = (dens_vap - e.x_low) * e.inv_dx;
      const double y_vap = (T - e.y_low) * e.inv_dy;
      double f_vap, dfdD_vap, dfdT_vap;
      get_two_phase_derivatives(x_vap, y_vap, dens_vap, &e, &f_vap, &dfdD_vap,
                                &dfdT_vap);
      Q = (dens_vap * (dens_liq - D)) / (D * (dens_liq - dens_vap));
      const double inte_liq = f_liq - T * dfdT_liq;
      const double inte_vap = f_vap - T * dfdT_vap;
      const double enth_liq = inte_liq + dens_liq * dfdD_liq;
      const double enth_vap = inte_vap + dens_vap * dfdD_vap;
      state->temp = T;
      state->pres = dens_vap * dens_vap *
                    dfdD_vap; // vapor pressure slightly more accurate
      state->dens = D;
      state->qual = Q;
      state->inte = inte_liq + Q * (inte_vap - inte_liq);
      state->enth = enth_liq + Q * (enth_vap - enth_liq);
      state->entr = Q * (dfdT_liq - dfdT_vap) -
                    dfdT_liq; // negative signs change order of terms
      state->cv = 0.0;
      state->cp = 0.0;
      state->ssnd = 0.0;
      state->sat_vap_dens = dens_vap;
      state->sat_liq_dens = dens_liq;
      return 0;
    }
  } else if (T > T_upper_limit) {
    zero_state(state);
    return 102;
  }

  Element e;
  find_element(T, D, &e);
  const double x = (D - e.x_low) * e.inv_dx;
  const double y = (T - e.y_low) * e.inv_dy;
  double f, dfdD, dfdD2, dfdT, dfdDdT, dfdT2;
  get_derivatives(x, y, D, &e, &f, &dfdD, &dfdD2, &dfdT, &dfdDdT, &dfdT2);

  const double P = D * D * dfdD;
  if (x < 0.0 || P < P_lower_limit) {
    zero_state(state);
    return 103;
  }
  if (x > 1.0 || y > 1.0 || P > P_upper_limit) {
    zero_state(state);
    return 104;
  }
  const double inte = f - T * dfdT;
  if (T >= T_crit && P < P_crit)
    Q = 998.0;

  state->temp = T;
  state->pres = P;
  state->dens = D;
  state->qual = Q;
  state->inte = inte;
  state->enth = inte + D * dfdD;
  state->entr = -dfdT;
  state->cv = -T * dfdT2;
  state->cp = T * (D * dfdDdT * dfdDdT / (2.0 * dfdD + D * dfdD2) - dfdT2);
  state->ssnd =
      sqrt(1000.0 * D * D * (dfdD2 - dfdDdT * dfdDdT / dfdT2 + 2.0 * dfdD / D));
  state->sat_vap_dens = dens_vap;
  state->sat_liq_dens = dens_liq;
  return 0;
}

